import React, { useState } from "react";
import { Menu, Switch, Button } from "antd";
import { Link } from "react-router-dom";
import "./css/styles.css";
import Media from "react-media";
import {
  MailOutlined,
  CalendarOutlined,
  AppstoreOutlined,
  SettingOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  HomeOutlined
} from "@ant-design/icons";
const Index = (props) => {
  const [fla, SetFla] = useState(0);
  const [now, SetNow] = useState('mail');
  const handleClick = e => {
      console.log('click ', e);
      SetNow(e.key);
  };
  const { SubMenu } = Menu;

  return (
    <div>
       <section className="banner">
            <nav className="navbar navbar-expand-lg navbar-dark ftco_navbar bg-dark ftco-navbar-light" id="ftco-navbar">
                <div className="container">
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#ftco-nav"
                        aria-controls="ftco-nav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="oi oi-menu"></span> Menu
                    </button>
                    <div className="collapse navbar-collapse" id="ftco-nav">
                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item" id="home"><Link to="/homepage" className="nav-link">Trang Chủ</Link></li>
                            <li className="nav-item dropdown" id="brands">
                                <a className="nav-link dropdown-toggle" id="dropdown04" data-toggle="dropdown" aria-haspopup="true"
                                    aria-expanded="false">Nhãn Hiệu</a>
                                <div className="dropdown-content">
                                    <Link to="/vans" >Vans</Link>
                                    <a >Converse</a>
                                    <a >Palladium</a>

                                </div>
                            </li>
                            <li className="nav-item dropdown" id="stores">
                                <a className="nav-link dropdown-toggle" id="dropdown04" data-toggle="dropdown" aria-haspopup="true"
                                    aria-expanded="false">Cửa Hàng</a>
                                <div className="dropdown-content">
                                    <a >TP.Ho Chi Minh</a>
                                    <a >TP.Ha Noi</a>
                                    <a >TP.Hue</a>
                                </div>
                            </li>
                            <li className="nav-item" id="about"><a className="nav-link">About</a></li>
                            <li className="nav-item" id="contact"><a className="nav-link">Liên Hệ</a></li>
                            <li className="nav-item" id="checkorder"><Link to="/checkorder" className="nav-link">Kiểm Tra Đơn Hàng</Link></li>
                            {
                                fla === 1 ? <li className="nav-item" id="login"><a className="nav-link">Login</a></li> :
                                    <li className="nav-item cta cta-colored">
                                        <Link className="nav-link" id="nameavatar" to="/personal">
                                            <img className="avatar" src="./image/toan.jpg" />
                                            <p>Toàn Phạm</p>
                                        </Link>
                                    </li>
                            }
                            <li class="nav-item"><Link to="/cart" class="nav-link"><span
                                class="fas fa-shopping-cart" id="cart"></span></Link>
                                <span class="dot">3</span>
                                </li>
                            {
                                fla === 1 ? null : <li className="nav-item" id="logout"><a className="nav-link">Đăng Xuất</a></li>
                            }
                        </ul>
                    </div>
                </div>
            </nav>
        </section>
    </div>
  );
};

export default Index;
